2.doc:
&lt;p&gt;Adds a custom location strategy based on a user keyword. Location strategies are automatically removed after leaving the current scope by default. Setting &lt;span class=&quot;name&quot;&gt;persist&lt;/span&gt; to any non-empty string will cause the location strategy to stay registered throughout the life of the test.&lt;/p&gt;
&lt;p&gt;Trying to add a custom location strategy with the same name as one that already exists will cause the keyword to fail.&lt;/p&gt;
&lt;p&gt;Custom locator keyword example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Custom Locator Strategy&lt;/td&gt;
&lt;td&gt;[Arguments]&lt;/td&gt;
&lt;td&gt;${browser}&lt;/td&gt;
&lt;td&gt;${criteria}&lt;/td&gt;
&lt;td&gt;${tag}&lt;/td&gt;
&lt;td&gt;${constraints}&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;${retVal}=&lt;/td&gt;
&lt;td&gt;Execute Javascript&lt;/td&gt;
&lt;td&gt;return window.document.getElementById(&#039;${criteria}&#039;);&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;[Return]&lt;/td&gt;
&lt;td&gt;${retVal}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Usage example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Add Location Strategy&lt;/td&gt;
&lt;td&gt;custom&lt;/td&gt;
&lt;td&gt;Custom Locator Strategy&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Page Should Contain Element&lt;/td&gt;
&lt;td&gt;custom=my_id&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;See &lt;a href=&quot;#Remove%20Location%20Strategy&quot; class=&quot;name&quot;&gt;Remove Location Strategy&lt;/a&gt; for details about removing a custom location strategy.&lt;/p&gt;

3.doc:
&lt;p&gt;Verifies an alert is present and dismisses it.&lt;/p&gt;
&lt;p&gt;If &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt; is a non-empty string, then it is also verified that the message of the alert equals to &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Will fail if no alert is present. Note that following keywords will fail unless the alert is dismissed by this keyword or another like &lt;a href=&quot;#Get%20Alert%20Message&quot; class=&quot;name&quot;&gt;Get Alert Message&lt;/a&gt;.&lt;/p&gt;

4.doc:
&lt;p&gt;Assigns a temporary identifier to element specified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;This is mainly useful if the locator is complicated/slow XPath expression. Identifier expires when the page is reloaded.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Assign ID to Element&lt;/td&gt;
&lt;td&gt;xpath=//div[@id=&quot;first_div&quot;]&lt;/td&gt;
&lt;td&gt;my id&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Page Should Contain Element&lt;/td&gt;
&lt;td&gt;my id&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

5.doc:
&lt;p&gt;Takes a screenshot of the current page and embeds it into the log.&lt;/p&gt;
&lt;p&gt;&lt;code&gt;filename&lt;/code&gt; argument specifies the name of the file to write the screenshot into. If no &lt;code&gt;filename&lt;/code&gt; is given, the screenshot is saved into file &lt;i&gt;selenium-screenshot-{index}.png&lt;/i&gt; under the directory where the Robot Framework log file is written into. The &lt;code&gt;filename&lt;/code&gt; is also considered relative to the same directory, if it is not given in absolute format. If an absolute or relative path is given but the path does not exist it will be created.&lt;/p&gt;
&lt;p&gt;Starting from Selenium2Library 1.8 if &lt;code&gt;filename&lt;/code&gt; contains &lt;i&gt;{index}&lt;/i&gt; characters, it will be automatically replaced with running index. The running index is unique for each different filename. The absolute path of the saved screenshot is always returned and it does not depend does the &lt;code&gt;filename&lt;/code&gt; contain &lt;i&gt;{index}&lt;/i&gt;. See example 1 and 2 for more details.&lt;/p&gt;
&lt;p&gt;The &lt;i&gt;{index}&lt;/i&gt; is replaced with the actual index by using Python&#039;s &lt;a href=&quot;https://docs.python.org/2/library/stdtypes.html#str.format&quot;&gt;str.format&lt;/a&gt; method, and it can be formatted using the standard &lt;a href=&quot;https://docs.python.org/2/library/string.html#format-string-syntax&quot;&gt;format string syntax&lt;/a&gt;. The example 3 shows this by setting the width and the fill character.&lt;/p&gt;
&lt;p&gt;If there is a need to write literal &lt;i&gt;{index}&lt;/i&gt; or if &lt;code&gt;filename&lt;/code&gt; contains &lt;i&gt;{&lt;/i&gt; or &lt;i&gt;}&lt;/i&gt; characters, then the braces must be doubled.&lt;/p&gt;
&lt;p&gt;Example 1:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${file1} =&lt;/td&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OUTPUTDIR}${/}selenium-screenshot-1.png&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${file1}&lt;/td&gt;
&lt;td&gt;${OUTPUTDIR}${/}selenium-screenshot-1.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${file2} =&lt;/td&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OUTPUTDIR}${/}selenium-screenshot-2.png&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${file2}&lt;/td&gt;
&lt;td&gt;${OUTPUTDIR}${/}selenium-screenshot-2.png&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Example 2:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${file1} =&lt;/td&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-{index}-name.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${file2} =&lt;/td&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}some-other-name-{index}.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${file3} =&lt;/td&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-{index}-name.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-1-name.png&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${file1}&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-1-name.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}some-other-name-1.png&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${file2}&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}some-other-name-1.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-2-name.png&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${file3}&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}other-2-name.png&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Example 3:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Capture Page Screenshot&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}sc-{index:06}.png&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;File Should Exist&lt;/td&gt;
&lt;td&gt;${OTHER_DIR}${/}sc-000001.png&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

9.doc:
&lt;p&gt;Inputs the &lt;span class=&quot;name&quot;&gt;file_path&lt;/span&gt; into file input field found by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;This keyword is most often used to input files into upload forms. The file specified with &lt;span class=&quot;name&quot;&gt;file_path&lt;/span&gt; must be available on the same host where the Selenium Server is running.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Choose File&lt;/td&gt;
&lt;td&gt;my_upload_field&lt;/td&gt;
&lt;td&gt;/home/user/files/trades.csv&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

17.doc:
&lt;p&gt;Closes all open browsers and resets the browser cache.&lt;/p&gt;
&lt;p&gt;After this keyword new indexes returned from &lt;a href=&quot;#Open%20Browser&quot; class=&quot;name&quot;&gt;Open Browser&lt;/a&gt; keyword are reset to 1.&lt;/p&gt;
&lt;p&gt;This keyword should be used in test or suite teardown to make sure all browsers are closed.&lt;/p&gt;

20.doc:
&lt;p&gt;Dismisses currently shown confirmation dialog and returns it&#039;s message.&lt;/p&gt;
&lt;p&gt;By default, this keyword chooses &#039;OK&#039; option from the dialog. If &#039;Cancel&#039; needs to be chosen, keyword &lt;a href=&quot;#Choose%20Cancel%20On%20Next%20Confirmation&quot; class=&quot;name&quot;&gt;Choose Cancel On Next Confirmation&lt;/a&gt; must be called before the action that causes the confirmation dialog to be shown.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Click Button&lt;/td&gt;
&lt;td&gt;Send&lt;/td&gt;
&lt;td&gt;# Shows a confirmation dialog&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${message}=&lt;/td&gt;
&lt;td&gt;Confirm Action&lt;/td&gt;
&lt;td&gt;# Chooses Ok&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${message}&lt;/td&gt;
&lt;td&gt;Are your sure?&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Choose Cancel On Next Confirmation&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Click Button&lt;/td&gt;
&lt;td&gt;Send&lt;/td&gt;
&lt;td&gt;# Shows a confirmation dialog&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Confirm Action&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;# Chooses Cancel&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

21.doc:
&lt;p&gt;Creates an instance of a WebDriver.&lt;/p&gt;
&lt;p&gt;Like &lt;a href=&quot;#Open%20Browser&quot; class=&quot;name&quot;&gt;Open Browser&lt;/a&gt;, but allows passing arguments to a WebDriver&#039;s __init__. &lt;i&gt;Open Browser&lt;/i&gt; is preferred over &lt;i&gt;Create Webdriver&lt;/i&gt; when feasible.&lt;/p&gt;
&lt;p&gt;Returns the index of this browser instance which can be used later to switch back to it. Index starts from 1 and is reset back to it when &lt;a href=&quot;#Close%20All%20Browsers&quot; class=&quot;name&quot;&gt;Close All Browsers&lt;/a&gt; keyword is used. See &lt;a href=&quot;#Switch%20Browser&quot; class=&quot;name&quot;&gt;Switch Browser&lt;/a&gt; for example.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;driver_name&lt;/span&gt; must be the exact name of a WebDriver in &lt;i&gt;selenium.webdriver&lt;/i&gt; to use. WebDriver names include: Firefox, Chrome, Ie, Opera, Safari, PhantomJS, and Remote.&lt;/p&gt;
&lt;p&gt;Use keyword arguments to specify the arguments you want to pass to the WebDriver&#039;s __init__. The values of the arguments are not processed in any way before being passed on. For Robot Framework &amp;lt; 2.8, which does not support keyword arguments, create a keyword dictionary and pass it in as argument &lt;span class=&quot;name&quot;&gt;kwargs&lt;/span&gt;. See the &lt;a href=&quot;http://selenium.googlecode.com/git/docs/api/py/api.html&quot;&gt;Selenium API Documentation&lt;/a&gt; for information about argument names and appropriate argument values.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;# use proxy for Firefox&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${proxy}=&lt;/td&gt;
&lt;td&gt;Evaluate&lt;/td&gt;
&lt;td&gt;sys.modules[&#039;selenium.webdriver&#039;].Proxy()&lt;/td&gt;
&lt;td&gt;sys, selenium.webdriver&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${proxy.http_proxy}=&lt;/td&gt;
&lt;td&gt;Set Variable&lt;/td&gt;
&lt;td&gt;localhost:8888&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Create Webdriver&lt;/td&gt;
&lt;td&gt;Firefox&lt;/td&gt;
&lt;td&gt;proxy=${proxy}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;# use a proxy for PhantomJS&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${service args}=&lt;/td&gt;
&lt;td&gt;Create List&lt;/td&gt;
&lt;td&gt;--proxy=192.168.132.104:8888&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Create Webdriver&lt;/td&gt;
&lt;td&gt;PhantomJS&lt;/td&gt;
&lt;td&gt;service_args=${service args}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Example for Robot Framework &amp;lt; 2.8:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;# debug IE driver&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${kwargs}=&lt;/td&gt;
&lt;td&gt;Create Dictionary&lt;/td&gt;
&lt;td&gt;log_level=DEBUG&lt;/td&gt;
&lt;td&gt;log_file=%{HOMEPATH}${/}ie.log&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Create Webdriver&lt;/td&gt;
&lt;td&gt;Ie&lt;/td&gt;
&lt;td&gt;kwargs=${kwargs}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

28.doc:
&lt;p&gt;Drags element identified with &lt;span class=&quot;name&quot;&gt;source&lt;/span&gt; which is a locator.&lt;/p&gt;
&lt;p&gt;Element can be moved on top of another element with &lt;span class=&quot;name&quot;&gt;target&lt;/span&gt; argument.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;target&lt;/span&gt; is a locator of the element where the dragged object is dropped.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Drag And Drop&lt;/td&gt;
&lt;td&gt;elem1&lt;/td&gt;
&lt;td&gt;elem2&lt;/td&gt;
&lt;td&gt;# Move elem1 over elem2.&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

29.doc:
&lt;p&gt;Drags element identified with &lt;span class=&quot;name&quot;&gt;source&lt;/span&gt; which is a locator.&lt;/p&gt;
&lt;p&gt;Element will be moved by xoffset and yoffset, each of which is a negative or positive number specify the offset.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Drag And Drop By Offset&lt;/td&gt;
&lt;td&gt;myElem&lt;/td&gt;
&lt;td&gt;50&lt;/td&gt;
&lt;td&gt;-35&lt;/td&gt;
&lt;td&gt;# Move myElem 50px right and 35px down.&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

32.doc:
&lt;p&gt;Verifies that the element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is visible.&lt;/p&gt;
&lt;p&gt;Herein, visible means that the element is logically visible, not optically visible in the current browser viewport. For example, an element that carries display:none is not logically visible, so using this keyword on that element would fail.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

33.doc:
&lt;p&gt;Verifies element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; contains text &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;If you wish to assert an exact (not a substring) match on the text of the element, use &lt;a href=&quot;#Element%20Text%20Should%20Be&quot; class=&quot;name&quot;&gt;Element Text Should Be&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

34.doc:
&lt;p&gt;Verifies that the element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is NOT visible.&lt;/p&gt;
&lt;p&gt;This is the opposite of &lt;a href=&quot;#Element%20Should%20Be%20Visible&quot; class=&quot;name&quot;&gt;Element Should Be Visible&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

35.doc:
&lt;p&gt;Verifies element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; does not contain text &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Element%20Should%20Contain&quot; class=&quot;name&quot;&gt;Element Should Contain&lt;/a&gt; for more details.&lt;/p&gt;

36.doc:
&lt;p&gt;Verifies element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; exactly contains text &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;In contrast to &lt;a href=&quot;#Element%20Should%20Contain&quot; class=&quot;name&quot;&gt;Element Should Contain&lt;/a&gt;, this keyword does not try a substring match but an exact match on the element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

37.doc:
&lt;p&gt;Executes asynchronous JavaScript code.&lt;/p&gt;
&lt;p&gt;Similar to &lt;a href=&quot;#Execute%20Javascript&quot; class=&quot;name&quot;&gt;Execute Javascript&lt;/a&gt; except that scripts executed with this keyword must explicitly signal they are finished by invoking the provided callback. This callback is always injected into the executed function as the last argument.&lt;/p&gt;
&lt;p&gt;Scripts must complete within the script timeout or this keyword will fail. See the &lt;a href=&quot;#Timeouts&quot; class=&quot;name&quot;&gt;Timeouts&lt;/a&gt; section for more information.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Execute Async JavaScript&lt;/td&gt;
&lt;td&gt;var callback = arguments[arguments.length - 1];&lt;/td&gt;
&lt;td&gt;window.setTimeout(callback, 2000);&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Execute Async JavaScript&lt;/td&gt;
&lt;td&gt;${CURDIR}/async_js_to_execute.js&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${retval}=&lt;/td&gt;
&lt;td&gt;Execute Async JavaScript&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;...&lt;/td&gt;
&lt;td&gt;var callback = arguments[arguments.length - 1];&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;...&lt;/td&gt;
&lt;td&gt;function answer(){callback(&quot;text&quot;);};&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;...&lt;/td&gt;
&lt;td&gt;window.setTimeout(answer, 2000);&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${retval}&lt;/td&gt;
&lt;td&gt;text&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

38.doc:
&lt;p&gt;Executes the given JavaScript code.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;code&lt;/span&gt; may contain multiple lines of code and may be divided into multiple cells in the test data. In that case, the parts are catenated together without adding spaces.&lt;/p&gt;
&lt;p&gt;If &lt;span class=&quot;name&quot;&gt;code&lt;/span&gt; is an absolute path to an existing file, the JavaScript to execute will be read from that file. Forward slashes work as a path separator on all operating systems.&lt;/p&gt;
&lt;p&gt;The JavaScript executes in the context of the currently selected frame or window as the body of an anonymous function. Use &lt;i&gt;window&lt;/i&gt; to refer to the window of your application and &lt;i&gt;document&lt;/i&gt; to refer to the document object of the current frame or window, e.g. &lt;i&gt;document.getElementById(&#039;foo&#039;)&lt;/i&gt;.&lt;/p&gt;
&lt;p&gt;This keyword returns None unless there is a return statement in the JavaScript. Return values are converted to the appropriate type in Python, including WebElements.&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Execute JavaScript&lt;/td&gt;
&lt;td&gt;window.my_js_function(&#039;arg1&#039;, &#039;arg2&#039;)&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Execute JavaScript&lt;/td&gt;
&lt;td&gt;${CURDIR}/js_to_execute.js&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${sum}=&lt;/td&gt;
&lt;td&gt;Execute JavaScript&lt;/td&gt;
&lt;td&gt;return 1 + 1;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${sum}&lt;/td&gt;
&lt;td&gt;${2}&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

40.doc:
&lt;p&gt;Verifies frame identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; contains &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain&quot; class=&quot;name&quot;&gt;Page Should Contain &lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;
&lt;p&gt;Key attributes for frames are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name.&lt;/span&gt; See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

47.doc:
&lt;p&gt;Returns horizontal position of element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The position is returned in pixels off the left side of the page, as an integer. Fails if a matching element is not found.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Get%20Vertical%20Position&quot; class=&quot;name&quot;&gt;Get Vertical Position&lt;/a&gt;.&lt;/p&gt;

50.doc:
&lt;p&gt;Returns number of elements matching &lt;span class=&quot;name&quot;&gt;xpath&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;One should not use the xpath= prefix for &#039;xpath&#039;. XPath is assumed.&lt;/p&gt;
&lt;p&gt;Correct:&lt;/p&gt;
&lt;pre&gt;count = | Get Matching Xpath Count | //div[@id=&#039;sales-pop&#039;]
&lt;/pre&gt;
&lt;p&gt;Incorrect:&lt;/p&gt;
&lt;pre&gt;count = | Get Matching Xpath Count | xpath=//div[@id=&#039;sales-pop&#039;]
&lt;/pre&gt;
&lt;p&gt;If you wish to assert the number of matching elements, use &lt;a href=&quot;#Xpath%20Should%20Match%20X%20Times&quot; class=&quot;name&quot;&gt;Xpath Should Match X Times&lt;/a&gt;.&lt;/p&gt;

52.doc:
&lt;p&gt;Returns the visible labels of selected elements (as a list) from the select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Fails if there is no selection.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

53.doc:
&lt;p&gt;Returns the value of the selected element from the select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Return value is read from &lt;span class=&quot;name&quot;&gt;value&lt;/span&gt; attribute of the selected element.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

54.doc:
&lt;p&gt;Returns the values of selected elements (as a list) from the select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Fails if there is no selection.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

59.doc:
&lt;p&gt;Returns the content from a table cell.&lt;/p&gt;
&lt;p&gt;Row and column number start from 1. Header and footer rows are included in the count. A negative row or column number can be used to get rows counting from the end (end: -1). Cell content from header or footer rows can be obtained with this keyword. To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain&quot; class=&quot;name&quot;&gt;Page Should Contain&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

63.doc:
&lt;p&gt;Returns vertical position of element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The position is returned in pixels off the top of the page, as an integer. Fails if a matching element is not found.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Get%20Horizontal%20Position&quot; class=&quot;name&quot;&gt;Get Horizontal Position&lt;/a&gt;.&lt;/p&gt;

68.doc:
&lt;p&gt;Returns current window position as &lt;span class=&quot;name&quot;&gt;x&lt;/span&gt; then &lt;span class=&quot;name&quot;&gt;y&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${x}&lt;/td&gt;
&lt;td&gt;${y}=&lt;/td&gt;
&lt;td&gt;Get Window Position&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

69.doc:
&lt;p&gt;Returns current window size as &lt;span class=&quot;name&quot;&gt;width&lt;/span&gt; then &lt;span class=&quot;name&quot;&gt;height&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${width}&lt;/td&gt;
&lt;td&gt;${height}=&lt;/td&gt;
&lt;td&gt;Get Window Size&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

76.doc:
&lt;p&gt;Verifies the selection of select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is exactly &lt;span class=&quot;name&quot;&gt;*items&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;If you want to test that no option is selected, simply give no &lt;span class=&quot;name&quot;&gt;items&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

81.doc:
&lt;p&gt;Verifies that the page contains the given number of elements located by the given &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;

86.doc:
&lt;p&gt;Simulates pressing the left mouse button on the element specified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The element is pressed without releasing the mouse button.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;
&lt;p&gt;See also the more specific keywords &lt;a href=&quot;#Mouse%20Down%20On%20Image&quot; class=&quot;name&quot;&gt;Mouse Down On Image&lt;/a&gt; and &lt;a href=&quot;#Mouse%20Down%20On%20Link&quot; class=&quot;name&quot;&gt;Mouse Down On Link&lt;/a&gt;.&lt;/p&gt;

92.doc:
&lt;p&gt;Opens a new browser instance to given URL.&lt;/p&gt;
&lt;p&gt;Returns the index of this browser instance which can be used later to switch back to it. Index starts from 1 and is reset back to it when &lt;a href=&quot;#Close%20All%20Browsers&quot; class=&quot;name&quot;&gt;Close All Browsers&lt;/a&gt; keyword is used. See &lt;a href=&quot;#Switch%20Browser&quot; class=&quot;name&quot;&gt;Switch Browser&lt;/a&gt; for example.&lt;/p&gt;
&lt;p&gt;Optional alias is an alias for the browser instance and it can be used for switching between browsers (just as index can be used). See &lt;a href=&quot;#Switch%20Browser&quot; class=&quot;name&quot;&gt;Switch Browser&lt;/a&gt; for more details.&lt;/p&gt;
&lt;p&gt;Possible values for &lt;span class=&quot;name&quot;&gt;browser&lt;/span&gt; are as follows:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;firefox&lt;/td&gt;
&lt;td&gt;FireFox&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;ff&lt;/td&gt;
&lt;td&gt;FireFox&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;internetexplorer&lt;/td&gt;
&lt;td&gt;Internet Explorer&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;ie&lt;/td&gt;
&lt;td&gt;Internet Explorer&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;googlechrome&lt;/td&gt;
&lt;td&gt;Google Chrome&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;gc&lt;/td&gt;
&lt;td&gt;Google Chrome&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;chrome&lt;/td&gt;
&lt;td&gt;Google Chrome&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;opera&lt;/td&gt;
&lt;td&gt;Opera&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;phantomjs&lt;/td&gt;
&lt;td&gt;PhantomJS&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;htmlunit&lt;/td&gt;
&lt;td&gt;HTMLUnit&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;htmlunitwithjs&lt;/td&gt;
&lt;td&gt;HTMLUnit with Javascipt support&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;android&lt;/td&gt;
&lt;td&gt;Android&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;iphone&lt;/td&gt;
&lt;td&gt;Iphone&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;safari&lt;/td&gt;
&lt;td&gt;Safari&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;edge&lt;/td&gt;
&lt;td&gt;Edge&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Note, that you will encounter strange behavior, if you open multiple Internet Explorer browser instances. That is also why &lt;a href=&quot;#Switch%20Browser&quot; class=&quot;name&quot;&gt;Switch Browser&lt;/a&gt; only works with one IE browser at most. For more information see: &lt;a href=&quot;http://selenium-grid.seleniumhq.org/faq.html#i_get_some_strange_errors_when_i_run_multiple_internet_explorer_instances_on_the_same_machine&quot;&gt;http://selenium-grid.seleniumhq.org/faq.html#i_get_some_strange_errors_when_i_run_multiple_internet_explorer_instances_on_the_same_machine&lt;/a&gt;&lt;/p&gt;
&lt;p&gt;Optional &#039;remote_url&#039; is the url for a remote selenium server for example &lt;a href=&quot;http://127.0.0.1:4444/wd/hub&quot;&gt;http://127.0.0.1:4444/wd/hub&lt;/a&gt;. If you specify a value for remote you can also specify &#039;desired_capabilities&#039; which is a string in the form key1:val1,key2:val2 that will be used to specify desired_capabilities to the remote server. This is useful for doing things like specify a proxy server for internet explorer or for specify browser and os if your using saucelabs.com. &#039;desired_capabilities&#039; can also be a dictonary (created with &#039;Create Dictionary&#039;) to allow for more complex configurations.&lt;/p&gt;
&lt;p&gt;Optional &#039;ff_profile_dir&#039; is the path to the firefox profile dir if you wish to overwrite the default.&lt;/p&gt;

95.doc:
&lt;p&gt;Verifies button identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;This keyword searches for buttons created with either &lt;span class=&quot;name&quot;&gt;input&lt;/span&gt; or &lt;span class=&quot;name&quot;&gt;button&lt;/span&gt; tag.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for buttons are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;value&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

96.doc:
&lt;p&gt;Verifies checkbox identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for checkboxes are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

97.doc:
&lt;p&gt;Verifies element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found on the current page.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override default error message.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain&quot; class=&quot;name&quot;&gt;Page Should Contain&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

98.doc:
&lt;p&gt;Verifies image identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for images are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;src&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;alt&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

99.doc:
&lt;p&gt;Verifies link identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for links are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;href&lt;/span&gt; and link text. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

100.doc:
&lt;p&gt;Verifies select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

101.doc:
&lt;p&gt;Verifies radio button identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
