&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for buttons are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;value&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

105.doc:
&lt;p&gt;Verifies checkbox identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for checkboxes are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

106.doc:
&lt;p&gt;Verifies element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found on the current page.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain&quot; class=&quot;name&quot;&gt;Page Should Contain &lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;
&lt;p&gt;Key attributes for arbitrary elements are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

107.doc:
&lt;p&gt;Verifies image identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for images are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;src&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;alt&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

108.doc:
&lt;p&gt;Verifies image identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for images are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;src&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;alt&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

109.doc:
&lt;p&gt;Verifies select list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

110.doc:
&lt;p&gt;Verifies radio button identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for radio buttons are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt;, &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;value&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

111.doc:
&lt;p&gt;Verifies text field identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not found from current page.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
&lt;p&gt;Key attributes for text fields are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

112.doc:
&lt;p&gt;Simulates user pressing key on element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;. &lt;span class=&quot;name&quot;&gt;key&lt;/span&gt; is either a single character, a string, or a numerical ASCII code of the key lead by &#039;\&#039;. Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Press Key&lt;/td&gt;
&lt;td&gt;text_field&lt;/td&gt;
&lt;td&gt;q&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Press Key&lt;/td&gt;
&lt;td&gt;text_field&lt;/td&gt;
&lt;td&gt;abcde&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Press Key&lt;/td&gt;
&lt;td&gt;login_button&lt;/td&gt;
&lt;td&gt;\13&lt;/td&gt;
&lt;td&gt;# ASCII code for enter key&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

115.doc:
&lt;p&gt;Sets the keyword to execute when a Selenium2Library keyword fails.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;keyword_name&lt;/span&gt; is the name of a keyword (from any available libraries) that  will be executed if a Selenium2Library keyword fails. It is not possible to use a keyword that requires arguments. Using the value &quot;Nothing&quot; will disable this feature altogether.&lt;/p&gt;
&lt;p&gt;The initial keyword to use is set in &lt;a href=&quot;#Importing&quot; class=&quot;name&quot;&gt;importing&lt;/a&gt;, and the keyword that is used by default is &lt;a href=&quot;#Capture%20Page%20Screenshot&quot; class=&quot;name&quot;&gt;Capture Page Screenshot&lt;/a&gt;. Taking a screenshot when something failed is a very useful feature, but notice that it can slow down the execution.&lt;/p&gt;
&lt;p&gt;This keyword returns the name of the previously registered failure keyword. It can be used to restore the original value later.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Register Keyword To Run On Failure&lt;/td&gt;
&lt;td&gt;Log Source&lt;/td&gt;
&lt;td&gt;# Run &lt;a href=&quot;#Log%20Source&quot; class=&quot;name&quot;&gt;Log Source&lt;/a&gt; on failure.&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${previous kw}=&lt;/td&gt;
&lt;td&gt;Register Keyword To Run On Failure&lt;/td&gt;
&lt;td&gt;Nothing&lt;/td&gt;
&lt;td&gt;# Disables run-on-failure functionality and stores the previous kw name in a variable.&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Register Keyword To Run On Failure&lt;/td&gt;
&lt;td&gt;${previous kw}&lt;/td&gt;
&lt;td&gt;# Restore to the previous keyword.&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;This run-on-failure functionality only works when running tests on Python/Jython 2.4 or newer and it does not work on IronPython at all.&lt;/p&gt;

121.doc:
&lt;p&gt;Selects &lt;span class=&quot;name&quot;&gt;*items&lt;/span&gt; from list identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;If more than one value is given for a single-selection list, the last value will be selected. If the target list is a multi-selection list, and &lt;span class=&quot;name&quot;&gt;*items&lt;/span&gt; is an empty list, all values of the list will be selected.&lt;/p&gt;
&lt;p&gt;*items try to select by value then by label.&lt;/p&gt;
&lt;p&gt;It&#039;s faster to use &#039;by index/value/label&#039; functions.&lt;/p&gt;
&lt;p&gt;An exception is raised for a single-selection list if the last value does not exist in the list and a warning for all other non- existing items. For a multi-selection list, an exception is raised for any and all non-existing values.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

125.doc:
&lt;p&gt;Sets selection of radio button group identified by &lt;span class=&quot;name&quot;&gt;group_name&lt;/span&gt; to &lt;span class=&quot;name&quot;&gt;value&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The radio button to be selected is located by two arguments:&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;&lt;span class=&quot;name&quot;&gt;group_name&lt;/span&gt; is used as the name of the radio input&lt;/li&gt;
&lt;li&gt;&lt;span class=&quot;name&quot;&gt;value&lt;/span&gt; is used for the value attribute or for the id attribute&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;The XPath used to locate the correct radio button then looks like this: //input[@type=&#039;radio&#039; and @name=&#039;group_name&#039; and (@value=&#039;value&#039; or @id=&#039;value&#039;)]&lt;/p&gt;
&lt;p&gt;Examples:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Select Radio Button&lt;/td&gt;
&lt;td&gt;size&lt;/td&gt;
&lt;td&gt;XL&lt;/td&gt;
&lt;td&gt;# Matches HTML like &amp;lt;input type=&quot;radio&quot; name=&quot;size&quot; value=&quot;XL&quot;&amp;gt;XL&amp;lt;/input&amp;gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Select Radio Button&lt;/td&gt;
&lt;td&gt;size&lt;/td&gt;
&lt;td&gt;sizeXL&lt;/td&gt;
&lt;td&gt;# Matches HTML like &amp;lt;input type=&quot;radio&quot; name=&quot;size&quot; value=&quot;XL&quot; id=&quot;sizeXL&quot;&amp;gt;XL&amp;lt;/input&amp;gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

126.doc:
&lt;p&gt;Selects the window matching locator and return previous window handle.&lt;/p&gt;
&lt;p&gt;locator: any of name, title, url, window handle, excluded handle&#039;s list, or special words. return: either current window handle before selecting, or None if no current window.&lt;/p&gt;
&lt;p&gt;If the window is found, all subsequent commands use that window, until this keyword is used again. If the window is not found, this keyword fails.&lt;/p&gt;
&lt;p&gt;By default, when a locator value is provided, it is matched against the title of the window and the javascript name of the window. If multiple windows with same identifier are found, the first one is selected.&lt;/p&gt;
&lt;p&gt;There are some special locators for searching target window: string &#039;main&#039; (default): select the main window; string &#039;self&#039;: only return current window handle; string &#039;new&#039;: select the last-indexed window assuming it is the newest opened window window list: select the first window not in given list (See &#039;List Windows&#039; to get the list)&lt;/p&gt;
&lt;p&gt;It is also possible to specify the approach Selenium2Library should take to find a window by specifying a locator strategy:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;&lt;b&gt;Strategy&lt;/b&gt;&lt;/td&gt;
&lt;td&gt;&lt;b&gt;Example&lt;/b&gt;&lt;/td&gt;
&lt;td&gt;&lt;b&gt;Description&lt;/b&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;title&lt;/td&gt;
&lt;td&gt;Select Window &lt;span class=&quot;name&quot;&gt;|&lt;/span&gt; title=My Document&lt;/td&gt;
&lt;td&gt;Matches by window title&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;name&lt;/td&gt;
&lt;td&gt;Select Window &lt;span class=&quot;name&quot;&gt;|&lt;/span&gt; name=${name}&lt;/td&gt;
&lt;td&gt;Matches by window javascript name&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;url&lt;/td&gt;
&lt;td&gt;Select Window &lt;span class=&quot;name&quot;&gt;|&lt;/span&gt; url=http://google.com&lt;/td&gt;
&lt;td&gt;Matches by window&#039;s current URL&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Click Link&lt;/td&gt;
&lt;td&gt;popup_link&lt;/td&gt;
&lt;td&gt;# opens new window&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Select Window&lt;/td&gt;
&lt;td&gt;popupName&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Title Should Be&lt;/td&gt;
&lt;td&gt;Popup Title&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Select Window&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;# Chooses the main window again&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

127.doc:
&lt;p&gt;Sets current browser&#039;s implicit wait in seconds.&lt;/p&gt;
&lt;p&gt;From selenium 2 function &#039;Sets a sticky timeout to implicitly wait for an element to be found, or a command to complete. This method only needs to be called one time per session.&#039;&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Set Browser Implicit Wait&lt;/td&gt;
&lt;td&gt;10 seconds&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;See also &lt;a href=&quot;#Set%20Selenium%20Implicit%20Wait&quot; class=&quot;name&quot;&gt;Set Selenium Implicit Wait&lt;/a&gt;.&lt;/p&gt;

129.doc:
&lt;p&gt;Sets Selenium 2&#039;s default implicit wait in seconds and sets the implicit wait for all open browsers.&lt;/p&gt;
&lt;p&gt;From selenium 2 function &#039;Sets a sticky timeout to implicitly wait for an element to be found, or a command to complete. This method only needs to be called one time per session.&#039;&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${orig wait} =&lt;/td&gt;
&lt;td&gt;Set Selenium Implicit Wait&lt;/td&gt;
&lt;td&gt;10 seconds&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Perform AJAX call that is slow&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Set Selenium Implicit Wait&lt;/td&gt;
&lt;td&gt;${orig wait}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

130.doc:
&lt;p&gt;Sets the delay in seconds that is waited after each Selenium command.&lt;/p&gt;
&lt;p&gt;This is useful mainly in slowing down the test execution to be able to view the execution. &lt;span class=&quot;name&quot;&gt;seconds&lt;/span&gt; may be given in Robot Framework time format. Returns the previous speed value.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Set Selenium Speed&lt;/td&gt;
&lt;td&gt;.5 seconds&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

131.doc:
&lt;p&gt;Sets the timeout in seconds used by various keywords.&lt;/p&gt;
&lt;p&gt;There are several &lt;span class=&quot;name&quot;&gt;Wait ...&lt;/span&gt; keywords that take timeout as an argument. All of these timeout arguments are optional. The timeout used by all of them can be set globally using this keyword. See &lt;a href=&quot;#Timeouts&quot; class=&quot;name&quot;&gt;Timeouts&lt;/a&gt; for more information about timeouts.&lt;/p&gt;
&lt;p&gt;The previous timeout value is returned by this keyword and can be used to set the old value back later. The default timeout is 5 seconds, but it can be altered in &lt;a href=&quot;#Importing&quot; class=&quot;name&quot;&gt;importing&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${orig timeout} =&lt;/td&gt;
&lt;td&gt;Set Selenium Timeout&lt;/td&gt;
&lt;td&gt;15 seconds&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Open page that loads slowly&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Set Selenium Timeout&lt;/td&gt;
&lt;td&gt;${orig timeout}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

132.doc:
&lt;p&gt;Sets the position &lt;span class=&quot;name&quot;&gt;x&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;y&lt;/span&gt; of the current window to the specified values.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Set Window Size&lt;/td&gt;
&lt;td&gt;${1000}&lt;/td&gt;
&lt;td&gt;${0}&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${x}&lt;/td&gt;
&lt;td&gt;${y}=&lt;/td&gt;
&lt;td&gt;Get Window Position&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${x}&lt;/td&gt;
&lt;td&gt;${1000}&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${y}&lt;/td&gt;
&lt;td&gt;${0}&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

133.doc:
&lt;p&gt;Sets the &lt;span class=&quot;name&quot;&gt;width&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;height&lt;/span&gt; of the current window to the specified values.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Set Window Size&lt;/td&gt;
&lt;td&gt;${800}&lt;/td&gt;
&lt;td&gt;${600}&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;${width}&lt;/td&gt;
&lt;td&gt;${height}=&lt;/td&gt;
&lt;td&gt;Get Window Size&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${width}&lt;/td&gt;
&lt;td&gt;${800}&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Should Be Equal&lt;/td&gt;
&lt;td&gt;${height}&lt;/td&gt;
&lt;td&gt;${600}&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

134.doc:
&lt;p&gt;Simulates &lt;span class=&quot;name&quot;&gt;event&lt;/span&gt; on element identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;This keyword is useful if element has OnEvent handler that needs to be explicitly invoked.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

136.doc:
&lt;p&gt;Switches between active browsers using index or alias.&lt;/p&gt;
&lt;p&gt;Index is returned from &lt;a href=&quot;#Open%20Browser&quot; class=&quot;name&quot;&gt;Open Browser&lt;/a&gt; and alias can be given to it.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Open Browser&lt;/td&gt;
&lt;td&gt;&lt;a href=&quot;http://google.com&quot;&gt;http://google.com&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;ff&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Location Should Be&lt;/td&gt;
&lt;td&gt;&lt;a href=&quot;http://google.com&quot;&gt;http://google.com&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Open Browser&lt;/td&gt;
&lt;td&gt;&lt;a href=&quot;http://yahoo.com&quot;&gt;http://yahoo.com&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;ie&lt;/td&gt;
&lt;td&gt;2nd conn&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Location Should Be&lt;/td&gt;
&lt;td&gt;&lt;a href=&quot;http://yahoo.com&quot;&gt;http://yahoo.com&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Switch Browser&lt;/td&gt;
&lt;td&gt;1&lt;/td&gt;
&lt;td&gt;# index&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Page Should Contain&lt;/td&gt;
&lt;td&gt;I&#039;m feeling lucky&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Switch Browser&lt;/td&gt;
&lt;td&gt;2nd conn&lt;/td&gt;
&lt;td&gt;# alias&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Page Should Contain&lt;/td&gt;
&lt;td&gt;More Yahoo!&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Close All Browsers&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;Above example expects that there was no other open browsers when opening the first one because it used index &#039;1&#039; when switching to it later. If you aren&#039;t sure about that you can store the index into a variable as below.&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;${id} =&lt;/td&gt;
&lt;td&gt;Open Browser&lt;/td&gt;
&lt;td&gt;&lt;a href=&quot;http://google.com&quot;&gt;http://google.com&lt;/a&gt;&lt;/td&gt;
&lt;td&gt;*firefox&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;# Do something ...&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Switch Browser&lt;/td&gt;
&lt;td&gt;${id}&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;td&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;

137.doc:
&lt;p&gt;Verifies that a certain cell in a table contains &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Row and column number start from 1. This keyword passes if the specified cell contains the given content. If you want to test that the cell content matches exactly, or that it e.g. starts with some text, use &lt;a href=&quot;#Get%20Table%20Cell&quot; class=&quot;name&quot;&gt;Get Table Cell&lt;/a&gt; keyword in combination with built-in keywords such as &lt;span class=&quot;name&quot;&gt;Should Be Equal&lt;/span&gt; or &lt;span class=&quot;name&quot;&gt;Should Start With&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain&quot; class=&quot;name&quot;&gt;Page Should Contain&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

138.doc:
&lt;p&gt;Verifies that a specific column contains &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The first leftmost column is column number 1. A negative column number can be used to get column counting from the end of the row (end: -1). If the table contains cells that span multiple columns, those merged cells count as a single column. For example both tests below work, if in one row columns A and B are merged with colspan=&quot;2&quot;, and the logical third column contains &quot;C&quot;.&lt;/p&gt;
&lt;p&gt;Example:&lt;/p&gt;
&lt;table border=&quot;1&quot;&gt;
&lt;tbody&gt;&lt;tr&gt;
&lt;td&gt;Table Column Should Contain&lt;/td&gt;
&lt;td&gt;tableId&lt;/td&gt;
&lt;td&gt;3&lt;/td&gt;
&lt;td&gt;C&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
&lt;td&gt;Table Column Should Contain&lt;/td&gt;
&lt;td&gt;tableId&lt;/td&gt;
&lt;td&gt;2&lt;/td&gt;
&lt;td&gt;C&lt;/td&gt;
&lt;/tr&gt;
&lt;/tbody&gt;&lt;/table&gt;
&lt;p&gt;To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

139.doc:
&lt;p&gt;Verifies that the table footer contains &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;With table footer can be described as any &amp;lt;td&amp;gt;-element that is child of a &amp;lt;tfoot&amp;gt;-element.  To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

140.doc:
&lt;p&gt;Verifies that the table header, i.e. any &amp;lt;th&amp;gt;...&amp;lt;/th&amp;gt; element, contains &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

141.doc:
&lt;p&gt;Verifies that a specific table row contains &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;The uppermost row is row number 1. A negative column number can be used to get column counting from the end of the row (end: -1). For tables that are structured with thead, tbody and tfoot, only the tbody section is searched. Please use &lt;a href=&quot;#Table%20Header%20Should%20Contain&quot; class=&quot;name&quot;&gt;Table Header Should Contain&lt;/a&gt; or &lt;a href=&quot;#Table%20Footer%20Should%20Contain&quot; class=&quot;name&quot;&gt;Table Footer Should Contain&lt;/a&gt; for tests against the header or footer content.&lt;/p&gt;
&lt;p&gt;If the table contains cells that span multiple rows, a match only occurs for the uppermost row of those merged cells. To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

142.doc:
&lt;p&gt;Verifies that &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt; can be found somewhere in the table.&lt;/p&gt;
&lt;p&gt;To understand how tables are identified, please take a look at the &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt;.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; argument.&lt;/p&gt;

143.doc:
&lt;p&gt;Verifies text area identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; contains text &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for text areas are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

144.doc:
&lt;p&gt;Verifies the value in text area identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is exactly &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for text areas are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

145.doc:
&lt;p&gt;Verifies text field identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; contains text &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for text fields are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

146.doc:
&lt;p&gt;Verifies the value in text field identified by &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is exactly &lt;span class=&quot;name&quot;&gt;expected&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; can be used to override default error message.&lt;/p&gt;
&lt;p&gt;Key attributes for text fields are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

150.doc:
&lt;p&gt;Unselects given values from select list identified by locator.&lt;/p&gt;
&lt;p&gt;As a special case, giving empty list as &lt;span class=&quot;name&quot;&gt;*items&lt;/span&gt; will remove all selections.&lt;/p&gt;
&lt;p&gt;*items try to unselect by value AND by label.&lt;/p&gt;
&lt;p&gt;It&#039;s faster to use &#039;by index/value/label&#039; functions.&lt;/p&gt;
&lt;p&gt;Select list keywords work on both lists and combo boxes. Key attributes for select lists are &lt;span class=&quot;name&quot;&gt;id&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;name&lt;/span&gt;. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for details about locating elements.&lt;/p&gt;

154.doc:
&lt;p&gt;Waits until the given &lt;span class=&quot;name&quot;&gt;condition&lt;/span&gt; is true or &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires.&lt;/p&gt;
&lt;p&gt;The &lt;span class=&quot;name&quot;&gt;condition&lt;/span&gt; can be arbitrary JavaScript expression but must contain a return statement (with the value to be returned) at the end. See &lt;a href=&quot;#Execute%20Javascript&quot; class=&quot;name&quot;&gt;Execute JavaScript&lt;/a&gt; for information about accessing the actual contents of the window through JavaScript.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

155.doc:
&lt;p&gt;Waits until given element contains &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the text appears on given element. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

156.doc:
&lt;p&gt;Waits until given element does not contain &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the text disappears from given element. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

157.doc:
&lt;p&gt;Waits until element specified with &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is enabled.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the element is enabled. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

158.doc:
&lt;p&gt;Waits until element specified with &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is not visible.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the element is not visible. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

159.doc:
&lt;p&gt;Waits until element specified with &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; is visible.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the element is visible. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

160.doc:
&lt;p&gt;Waits until &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt; appears on current page.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the text appears. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains%20Element&quot; class=&quot;name&quot;&gt;Wait Until Page Contains Element&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

161.doc:
&lt;p&gt;Waits until element specified with &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; appears on current page.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the element appears. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

162.doc:
&lt;p&gt;Waits until &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt; disappears from current page.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the &lt;span class=&quot;name&quot;&gt;text&lt;/span&gt; disappears. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

163.doc:
&lt;p&gt;Waits until element specified with &lt;span class=&quot;name&quot;&gt;locator&lt;/span&gt; disappears from current page.&lt;/p&gt;
&lt;p&gt;Fails if &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; expires before the element disappears. See &lt;a href=&quot;#Introduction&quot; class=&quot;name&quot;&gt;introduction&lt;/a&gt; for more information about &lt;span class=&quot;name&quot;&gt;timeout&lt;/span&gt; and its default value.&lt;/p&gt;
&lt;p&gt;&lt;span class=&quot;name&quot;&gt;error&lt;/span&gt; can be used to override the default error message.&lt;/p&gt;
&lt;p&gt;See also &lt;a href=&quot;#Wait%20Until%20Page%20Contains&quot; class=&quot;name&quot;&gt;Wait Until Page Contains&lt;/a&gt;, &lt;a href=&quot;#Wait%20For%20Condition&quot; class=&quot;name&quot;&gt;Wait For Condition&lt;/a&gt;, &lt;a href=&quot;#Wait%20Until%20Element%20Is%20Visible&quot; class=&quot;name&quot;&gt;Wait Until Element Is Visible&lt;/a&gt; and BuiltIn keyword &lt;span class=&quot;name&quot;&gt;Wait Until Keyword Succeeds&lt;/span&gt;.&lt;/p&gt;

164.doc:
&lt;p&gt;Verifies that the page contains the given number of elements located by the given &lt;span class=&quot;name&quot;&gt;xpath&lt;/span&gt;.&lt;/p&gt;
&lt;p&gt;One should not use the xpath= prefix for &#039;xpath&#039;. XPath is assumed.&lt;/p&gt;
&lt;p&gt;Correct:&lt;/p&gt;
&lt;pre&gt;Xpath Should Match X Times | //div[@id=&#039;sales-pop&#039;] | 1
&lt;/pre&gt;
&lt;p&gt;Incorrect:&lt;/p&gt;
&lt;pre&gt;Xpath Should Match X Times | xpath=//div[@id=&#039;sales-pop&#039;] | 1
&lt;/pre&gt;
&lt;p&gt;See &lt;a href=&quot;#Page%20Should%20Contain%20Element&quot; class=&quot;name&quot;&gt;Page Should Contain Element&lt;/a&gt; for explanation about &lt;span class=&quot;name&quot;&gt;message&lt;/span&gt; and &lt;span class=&quot;name&quot;&gt;loglevel&lt;/span&gt; arguments.&lt;/p&gt;
